<script>
import { ref, onMounted } from 'vue';
import gsap from 'gsap';


export default {
    name: 'Footer',
    setup() {
        const main = ref();
        let tl;

        let ctx;

        onMounted(() => {
            listenScroll();

            ctx = gsap.context((self) => {
                const persons0 = self.selector('.pattern0');
                const persons1 = self.selector('.pattern1');
                const persons2 = self.selector('.pattern2');
                const persons3 = self.selector('.pattern3');
                const persons4 = self.selector('.pattern4');

                tl = gsap
                    .timeline()
                    .to(persons0[0], { opacity: 1 })
                    .to(persons0[1], { opacity: 0 }, '<')
                    .to(persons1[0], { opacity: 1 }, '<')
                    .to(persons1[1], { opacity: 0 }, '<')
                    .to(persons2[0], { opacity: 1 }, '<')
                    .to(persons2[1], { opacity: 0 }, '<')
                    .to(persons3[0], { opacity: 1 }, '<')
                    .to(persons3[1], { opacity: 0 }, '<')
                    .to(persons4[0], { opacity: 1 }, '<')
                    .to(persons4[1], { opacity: 0 }, '<')
                    .reverse();
            }, main.value); // <- Scope!

            setTimeout(() => {
                tl.play()
            }, 2000)
        })

        const listenScroll = () => {
            window.addEventListener('scroll', () => {
                if (window.scrollY > 3200) tl.play();
                if (window.scrollY < 2883) tl.reverse();
            })
        }

        return { main }
    }
}
</script>

